    [],nt"revision_timestamp": "2013-03-15T11:49:15.675154",nt"name": "spatial-vegetation-data-for-fossil-butte-national-monument-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "This polygon feature class represents vegetation
    communities mapped at Fossil Butte National Monument. The polygons were generated
    using guidelines set by the Standardized National Vegetation Classification System
    (October 1995). Polygons were generated using machine learning, as well as on screen
    digitizing of vegetation map types using 2004 imagery flown for the vegetation mapping
    project. Additional data layers were used in aiding the interpretation, such as
    slope, hydrology, geography, and ground-collected vegetation information. The attributed
    vegetation classes were subjected to an accuracy assessment, following which final
    adjustments were made to the vegetation classes. As with any digital layer, this
    layer is a representation of what is actually occurring on the ground; errors are
    inherent in any interpretation of ground qualities. Due to the "snapshot" nature
    of the DOQs, this vegetation layer reflects conditions that existed when the imagery
    was collected.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
